import{_ as o}from"./chunks/cocos.CdS17Gzc.js";import{_ as s,c as r,o as t,a4 as a}from"./chunks/framework.uQk9_EO2.js";const n="/docs/cocos/assets/home.JJW-dK09.png",e="/docs/cocos/assets/home1.Dbg4gNlr.png",i="/docs/cocos/assets/project.CDmzA_MQ.png",c="/docs/cocos/assets/add-project.-bxwVNep.png",g="/docs/cocos/assets/installs.BM2gVdMM.png",l="/docs/cocos/assets/download.BOyPofoJ.png",p="/docs/cocos/assets/store.BTdSU_pp.png",d="/docs/cocos/assets/community.0fCLMlYk.png",h="/docs/cocos/assets/learn.DGuIUWMG.png",_="/docs/cocos/assets/account.5rFiVxzQ.png",z=JSON.parse('{"title":"使用 Dashboard","description":"","frontmatter":{},"headers":[],"relativePath":"zh/getting-started/dashboard/index.md","filePath":"zh/getting-started/dashboard/index.md","lastUpdated":1712305443000}'),m={name:"zh/getting-started/dashboard/index.md"},b=a('<h1 id="使用-dashboard" tabindex="-1">使用 Dashboard <a class="header-anchor" href="#使用-dashboard" aria-label="Permalink to &quot;使用 Dashboard&quot;">​</a></h1><p>启动 Cocos Dashboard 并使用 Cocos 开发者帐号登录以后，就会打开 Dashboard 窗口，在这里你可以下载引擎、新建项目、打开已有项目或者获得帮助信息。</p><p><img src="'+n+'" alt="Dashboard"></p><p>左侧导航菜单栏包括：<strong>首页</strong>、<strong>项目</strong>、<strong>编辑器</strong>、<strong>商城</strong>、<strong>动态</strong>、<strong>学习</strong>、<strong>设置</strong> 和 <strong>账号</strong>，具体说明请查看下文。</p><h2 id="首页" tabindex="-1">首页 <a class="header-anchor" href="#首页" aria-label="Permalink to &quot;首页&quot;">​</a></h2><p>首页集合 Cocos 的产品动态、版本动态以及用户最近打开的项目，可在此快捷打开项目、新建项目、安装编辑器、获取最新编辑器版本等。</p><p><img src="'+e+'" alt="Dashboard"></p><p>主要包括以下三部分内容：</p><ul><li>轮播图：展示 Cocos 最近的产品动态；</li><li>最近打开：展示用户最近打开的项目，<strong>双击</strong> 可打开项目；右上方的 <strong>新建项目</strong> 按钮可快捷打开新建项目页以创建项目，<strong>查看更多</strong> 按钮可前往项目列表页面。</li><li>编辑器：展示 Cocos 已发布的产品，可在此快捷安装编辑器版本、新建项目，以及获取最新发布的编辑器版本。</li></ul><h2 id="项目" tabindex="-1">项目 <a class="header-anchor" href="#项目" aria-label="Permalink to &quot;项目&quot;">​</a></h2><p>项目页展示所有创建/导入的项目，<strong>双击</strong> 可打开项目；第一次运行 Cocos Dashboard 时列表是空的，可以在右上角新建/导入项目；</p><p><img src="'+i+'" alt="Dashboard"></p><p>右上方的 <strong>导入项目</strong> 按钮用于导入其他本地项目；<strong>新建项目</strong> 按钮用于新建项目，点击该按钮会打开 <strong>新建项目</strong> 页面，详情可参考下方介绍。</p><p>项目列表支持以下功能：</p><ul><li><strong>1</strong>：通过项目名称直接搜索项目；</li><li><strong>2</strong>：可根据最近打开时间正序/反序排列项目；</li><li><strong>3</strong>：可选择其他已安装成功的编辑器版本打开项目；</li><li><strong>4</strong>：操作菜单，也可通过右键打开。支持 <strong>打开（项目）</strong>、<strong>在 Finder/资源管理器中显示</strong>、<strong>从列表中移除</strong>、<strong>选择项目的图标</strong>、<strong>重命名项目</strong>、<strong>设置项目的描述</strong>： <ul><li><strong>选择项目的图标</strong>：自定义项目封面图，目前支持 BMP、PNG、GIF、JPG 四种格式；</li><li><strong>重命名项目</strong>：重命名项目名称，同时也将重命名项目文件夹；</li><li><strong>设置项目的描述</strong>：可用于备注项目相关的描述信息。</li></ul></li></ul><h3 id="新建项目" tabindex="-1">新建项目 <a class="header-anchor" href="#新建项目" aria-label="Permalink to &quot;新建项目&quot;">​</a></h3><p>Creator 提供了一些项目模板，包括了各种不同类型的游戏基本架构，以及学习用的范例资源和脚本，来帮助开发者更快进入到创造性的工作当中。随着 Cocos Creator 功能越来越完整，我们也会持续添加更多的项目模板。</p><p>点击左上方的 <strong>模版</strong> 和 <strong>案例</strong> 可切换项目类型；<strong>编辑器版本</strong> 用于选择创建项目的编辑器版本，下拉框中包括所有已安装成功的版本。</p><p><img src="'+c+'" alt="Dashboard"></p><p>选中任一项目模板，页面下方可以看到 <strong>项目名称</strong> 和 <strong>位置</strong>：</p><ul><li><strong>项目名称</strong>：项目名称只能包含 <strong>a-z</strong>、<strong>A-Z</strong>、<strong>0-9</strong> 以及 <strong>_</strong> 和 <strong>-</strong>；</li><li><strong>位置</strong>：点击项目路径输入框后面的图标即可选择项目的存放路径，也可以在输入框中手动输入。</li></ul><p>一切都设置好后，点击 <strong>创建并打开</strong> 按钮来完成项目的创建；Dashboard 窗口会被隐藏，然后新创建的项目会在 Cocos Creator 编辑器主窗口中打开。</p><h2 id="安装" tabindex="-1">安装 <a class="header-anchor" href="#安装" aria-label="Permalink to &quot;安装&quot;">​</a></h2><p>安装页展示已安装成功的产品编辑器，可以点击右上方的按钮导入/安装编辑器版本；</p><p><img src="'+g+'" alt="Dashboard"></p><p>需要注意的是，第一次运行 Cocos Dashboard 时，这个列表是空的，可以点击右上方的两个按钮导入本地已有的编辑器或者直接下载安装：</p><ul><li><p><strong>添加本地版本</strong>：用于添加本地已有的编辑器，支持直接将本地已有的 Creator 编辑器从操作系统的文件管理器拖拽到版本列表中；</p></li><li><p><strong>安装编辑器</strong>：点击该按钮会打开编辑器安装页，显示所有已安装和未安装的编辑器版本，可根据需要下载安装：</p><p><img src="'+l+'" alt="Download"></p></li></ul><h2 id="商城" tabindex="-1">商城 <a class="header-anchor" href="#商城" aria-label="Permalink to &quot;商城&quot;">​</a></h2><p>Cocos 游戏开发资源商城，可浏览、下载和安装官方或者第三方插件、源码、资源等，具体说明可参考 <a href="https://store.cocos.com/document/zh/" target="_blank" rel="noreferrer">Cocos Store</a>。</p><p><img src="'+p+'" alt="store"></p><h2 id="动态" tabindex="-1">动态 <a class="header-anchor" href="#动态" aria-label="Permalink to &quot;动态&quot;">​</a></h2><p>动态页主要展示 Cocos Creator 的一些官方信息、活动和 Creator 版本更新说明等，包括 <strong>新闻</strong> 和 <strong>更新日志</strong> 两个模块。</p><p><img src="'+d+'" alt="community"></p><h2 id="学习" tabindex="-1">学习 <a class="header-anchor" href="#学习" aria-label="Permalink to &quot;学习&quot;">​</a></h2><p>集合 Cocos 官方产出的教程资源，以及编辑推荐文章和论坛精华。</p><p><img src="'+h+'" alt="learn"></p><h2 id="账号" tabindex="-1">账号 <a class="header-anchor" href="#账号" aria-label="Permalink to &quot;账号&quot;">​</a></h2><p>展示当前登录的账号信息，可前往账户中心，以及退出登录等。</p><p><img src="'+_+'" alt="account"></p><p>点击下方各网站的图标可访问 Cocos 官方获取更多教程等信息，目前包括：</p><ul><li><p>Cocos 引擎官方微信公众号</p><p><img src="'+o+'" alt="Cocos"></p></li><li><p><a href="https://weibo.com/cocos2dx" target="_blank" rel="noreferrer">微博</a></p></li><li><p><a href="https://twitter.com/CocosEngine" target="_blank" rel="noreferrer">Twitter</a></p></li><li><p><a href="https://space.bilibili.com/491120849" target="_blank" rel="noreferrer">哔哩哔哩</a></p></li><li><p><a href="https://www.youtube.com/cocosengine" target="_blank" rel="noreferrer">YouTube</a></p></li><li><p><a href="https://github.com/cocos/cocos-engine" target="_blank" rel="noreferrer">GitHub</a></p></li></ul>',41),u=[b];function f(C,x,D,k,q,P){return t(),r("div",null,u)}const M=s(m,[["render",f]]);export{z as __pageData,M as default};
